import React from "react";
import { Link } from 'react-router-dom';
import ArtistsPage from "./ArtistsPage";


function ArtistsCard(props) {
    return (


        <div class="card bg-secondary text-white">
            <img class = "card-img-top" src= "./public/logo192.png" alt="artists photo" /> 
            <div class="card-header">               
            <Link to={`/artists/artistspage/${prop.artist.id}`}>Go to Artist Page</Link>


                {props.ArtistsName}</div>
            <div class="card-header">{props.Genre}</div>
            <div class="card-body p-5">{props.VenueList}</div>

        </div>


    );

}

export default ArtistsCard;
